query:
/*+ NoMergeJoin(mi_idx t mc) */ select count(*)
from title AS t
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND t.kind_id > 2 AND t.production_year > 1913 AND mi_idx.info_type_id < 101
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id < 133674 AND mc.company_type_id = 2;
